import { Icon } from '@iconify/react';
import React from 'react';
import { Link } from 'react-router-dom';

export default function Home() {
    return (
        <>
        <div>
        <h1 className='animate-character'> PlanetX 
        <a href='https://github.com/bhardwajakshit' className='github'><Icon icon= "line-md:github-loop" style="color: white;"></Icon></a>
        </h1>
        </div>
        <h1 className='stars'>
            <Link  to="/NasaPhoto">See into the stars!</Link>
        </h1>
        <h1 className='wildfire'>
            <Link  to="/WildFire">Track Wildfire</Link>
        </h1>
            <br />
            <Link className='home-link-right' to="/Perseverance">Mars</Link>
            <Link className='home-link-right' to="/Earth">Earth</Link>
        </>
    )
}
